DROP TABLE IF EXISTS `inventario_bien`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `inventario_bien` (
  `inventario_bien_id` int(11) NOT NULL AUTO_INCREMENT,
  `bien_id` int(11) DEFAULT NULL COMMENT 'referencia a la tabla bien',
  `inventario_id` int(11) NOT NULL COMMENT 'referencia a la tabla inventario',
  `estado_subida` varchar(1) DEFAULT 'N' COMMENT 'estado subida: S - subido, N - no subido [ estados acción/comando: I - insertar, A: actualizar, E - eliminar ] ]',
  `sobrante_faltante` varchar(1) DEFAULT NULL COMMENT 'S: sobrante, F: faltante, null: ninguno',
  `inventariador` varchar(50) DEFAULT NULL COMMENT 'inventariador responsable',
  `codigo_patrimonial` varchar(12) NOT NULL COMMENT 'antes codbien',
  `entidad_id` int(11) NOT NULL COMMENT 'antes codinst. Almacena codigo fisico propio de SIMIO y no el codigo de negocio del simi (son conceptos distintos)',
  `locales_id` int(11) DEFAULT NULL COMMENT 'codlocal. Almacena codigo fisico propio de SIMIO y no el codigo de negocio del simi (son conceptos distintos)',
  `area_id` int(11) DEFAULT NULL COMMENT 'antes codarea. Almacena codigo fisico propio de SIMIO y no el codigo de negocio del simi (son conceptos distintos)',
  `empleado_id` int(11) DEFAULT NULL COMMENT 'antes codusuario. Almacena codigo fisico propio de SIMIO y no el codigo de negocio del simi (son conceptos distintos)',
  `oficina_id` int(11) DEFAULT NULL COMMENT 'antes ubicacion. Almacena codigo fisico propio de SIMIO y no el codigo de negocio del simi (son conceptos distintos)',
  `tipo_causal_alta` varchar(50) DEFAULT NULL COMMENT 'antes tipo',
  `anho` int(4) DEFAULT NULL,
  `matricula` varchar(100) DEFAULT NULL,
  `ancho` double(20,2) DEFAULT NULL,
  `valor_libro` double(20,2) DEFAULT NULL COMMENT 'antes valorlibro',
  `cuenta_con_seguro` varchar(1) DEFAULT NULL COMMENT 'antes asegurado',
  `estado_bien` varchar(1) DEFAULT NULL COMMENT 'antes estado',
  `dimension` varchar(100) DEFAULT NULL,
  `condicion` varchar(1) DEFAULT NULL,
  `nro_doc_adquisicion` varchar(50) DEFAULT NULL COMMENT 'antes doc_alta',
  `color` varchar(100) DEFAULT NULL,
  `fecha_adquisicion` date DEFAULT NULL COMMENT 'antes fec_act',
  `ent_disp` varchar(200) DEFAULT NULL,
  `ent_arre` varchar(100) DEFAULT NULL,
  `fec_vafec` date DEFAULT NULL,
  `edad` varchar(100) DEFAULT NULL COMMENT 'quemao',
  `motivo_eliminacion_bien` varchar(200) DEFAULT NULL COMMENT 'antes causal_eli',
  `valor_adquisicion` double(20,2) DEFAULT NULL COMMENT 'antes valoradq',
  `anio_fabricacion` varchar(4) DEFAULT NULL COMMENT 'antes anho_fab',
  `resol_afec` varchar(25) DEFAULT NULL,
  `especie` varchar(100) DEFAULT NULL,
  `raza` varchar(100) DEFAULT NULL,
  `fec_afec` date DEFAULT NULL,
  `flg_acto` varchar(100) DEFAULT NULL COMMENT 'en el excel es ACTO_DISPOSICION_BIEN ',
  `modelo` varchar(100) DEFAULT NULL,
  `flg_causal` varchar(1) DEFAULT NULL COMMENT 'del excel es TIPO_CAUSAL_ALTA',
  `marca` varchar(100) DEFAULT NULL,
  `nro_resolucion_baja` varchar(50) DEFAULT NULL COMMENT 'antes resol_baja',
  `resol_arre` varchar(25) DEFAULT NULL,
  `dsc_otros` varchar(500) DEFAULT NULL,
  `fec_arre` date DEFAULT NULL,
  `fecha_disposicion` date DEFAULT NULL COMMENT 'antes fec_disp',
  `resol_disp` varchar(50) DEFAULT NULL,
  `altura` varchar(20) DEFAULT NULL COMMENT 'convertir de numero a cadena. usar . como separador decimal, y no usar nada para separador de miles',
  `nro_chasis` varchar(100) DEFAULT NULL COMMENT 'antes numchasis',
  `valortasa` varchar(100) DEFAULT NULL COMMENT 'convertir de numero a cadena. usar . como separador decimal, y no usar nada para separador de miles',
  `placa` varchar(100) DEFAULT NULL,
  `sit_binv` varchar(1) DEFAULT NULL COMMENT 'situacion del inventario: encontrado o no encontrado',
  `nro_cuenta_contable` varchar(20) DEFAULT NULL COMMENT 'antes cuenta',
  `serie` varchar(100) DEFAULT NULL,
  `est_bien` varchar(1) DEFAULT NULL,
  `ent_afec` varchar(100) DEFAULT NULL,
  `codanterio` varchar(15) DEFAULT NULL COMMENT 'codigo interno',
  `tipo_cuenta` varchar(1) DEFAULT NULL COMMENT 'antes tipo_cta',
  `est_gestio` varchar(1) DEFAULT NULL,
  `doc_baja` varchar(50) DEFAULT NULL,
  `nro_motor` varchar(100) DEFAULT NULL COMMENT 'antes nummotor',
  `longitud` varchar(20) DEFAULT NULL COMMENT 'convertir de numero a cadena. usar . como separador decimal, y no usar nada para separador de miles',
  `pais` varchar(100) DEFAULT NULL,
  `fecha_baja` date DEFAULT NULL COMMENT 'antes fec_baja',
  `fec_varre` date DEFAULT NULL,
  `denominacion_bien` varchar(120) DEFAULT NULL COMMENT 'no migrar, no esta en los dbf, campo nuevo excel',
  `fecha_depreciacion` date DEFAULT NULL COMMENT 'de aqui para abjao, todos son campos nuevos, no migrar',
  `valor_deprec_ejercicio` double(20,2) DEFAULT NULL,
  `valor_deprec_acumulado` double(20,2) DEFAULT NULL,
  `valor_neto` double(20,2) DEFAULT NULL,
  `tip_uso_cuenta` varchar(1) DEFAULT NULL,
  `catalogo_bien_id` int(11) DEFAULT NULL COMMENT 'Coger los primeros 8 caracteres del campo codigo_patrimonial, \ncon ese codigo ir a la tabla catalogo_bien y buscarlo en el campo campo codigo_bien, coger el autogerado de la tabla catalogo_bien y finalmente,\nsetear ese valor en el campo catalogo_bien_id de la tabla bien',
  `otras_caract` varchar(100) DEFAULT NULL,
  `descripcion_ubicacion_bien` varchar(200) DEFAULT NULL,
  `causal_baja` varchar(1) DEFAULT NULL,
  `acto_disposicion_bien` varchar(1) DEFAULT NULL,
  `entidad_beneficiada_acto_disposicion` varchar(200) DEFAULT NULL,
  `acto_administracion_bien` varchar(1) DEFAULT NULL,
  `num_resolucion_administracion` varchar(50) DEFAULT NULL,
  `fecha_administracion` date DEFAULT NULL,
  `fecha_venc_acto_admin` date DEFAULT NULL,
  `entidad_beneficiada_acto_admin` varchar(200) DEFAULT NULL,
  `doc_alta_sbn` varchar(25) DEFAULT NULL,
  `doc_baja_sbn` varchar(25) DEFAULT NULL,
  `ind_del` varchar(1) DEFAULT '0',
  `fec_reg` datetime DEFAULT NULL,
  `fec_act` datetime DEFAULT NULL,
  `usu_reg` varchar(50) DEFAULT NULL,
  `usu_act` varchar(50) DEFAULT NULL,
  `tipo` varchar(100) DEFAULT NULL,
  `nro_resolucion_disp` varchar(50) DEFAULT NULL,
  `codigo_barras` varchar(200) DEFAULT NULL,
  `inventariado_por` varchar(50) DEFAULT NULL,
  `revisado_toma` varchar(1) NOT NULL DEFAULT '0' COMMENT '1: revisado, 0: no revisado',
  `inventariador_anterior` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`inventario_bien_id`),
  UNIQUE KEY `codigo_patrimonial` (`codigo_patrimonial`,`entidad_id`,`inventario_id`),
  KEY `cod_usuario` (`empleado_id`),
  KEY `abreviatura_oficina` (`oficina_id`),
  KEY `FK_bien_area` (`area_id`),
  KEY `FK_bien_locales` (`locales_id`),
  KEY `FK_bien_entidad` (`entidad_id`),
  KEY `FK_bien_catalogo_bien` (`catalogo_bien_id`),
  KEY `FK_inventario_bien_bien_id` (`bien_id`),
  KEY `FK_inventario_bien_inventario_id` (`inventario_id`),
  KEY `FK_inventario_bien_inventariador` (`inventariador`),
  KEY `inventario_bien_ind_del_IDX` (`ind_del`),
  CONSTRAINT `FK_inventario_bien_area` FOREIGN KEY (`area_id`) REFERENCES `area` (`area_id`),
  CONSTRAINT `FK_inventario_bien_bien_id` FOREIGN KEY (`bien_id`) REFERENCES `bien` (`bien_id`),
  CONSTRAINT `FK_inventario_bien_catalogo_bien` FOREIGN KEY (`catalogo_bien_id`) REFERENCES `catalogo_bien` (`catalogo_bien_id`),
  CONSTRAINT `FK_inventario_bien_empleado` FOREIGN KEY (`empleado_id`) REFERENCES `empleado` (`empleado_id`),
  CONSTRAINT `FK_inventario_bien_entidad` FOREIGN KEY (`entidad_id`) REFERENCES `entidad` (`entidad_id`),
  CONSTRAINT `FK_inventario_bien_inventariador` FOREIGN KEY (`inventariador`) REFERENCES `usuario` (`usuario_id`),
  CONSTRAINT `FK_inventario_bien_inventario_id` FOREIGN KEY (`inventario_id`) REFERENCES `inventario` (`inventario_id`),
  CONSTRAINT `FK_inventario_bien_locales` FOREIGN KEY (`locales_id`) REFERENCES `locales` (`locales_id`),
  CONSTRAINT `FK_inventario_bien_oficina` FOREIGN KEY (`oficina_id`) REFERENCES `oficina` (`oficina_id`)
) ENGINE=InnoDB AUTO_INCREMENT=17177 DEFAULT CHARSET=utf8;
