  `nombres` varchar(100) DEFAULT NULL COMMENT 'nombres a mostrar (referencial)',
  `apellidos` varchar(100) DEFAULT NULL COMMENT 'apellidos a mostrar (referencial)',
  `clave_id` int(11) DEFAULT NULL,
  `ind_del` varchar(1) DEFAULT '0' COMMENT '0 = activo ; 1 = eliminado',
  `usu_reg` varchar(50) DEFAULT NULL,
  `fec_reg` datetime DEFAULT NULL,
  `usu_act` varchar(50) DEFAULT NULL,
  `fec_act` datetime DEFAULT NULL,
  PRIMARY KEY (`usuario_id`),
  KEY `FK_usuario_entidad` (`entidad_id`),
  KEY `FK_usuario_clave` (`clave_id`),
  KEY `usuario_ind_del_IDX` (`ind_del`),
  CONSTRAINT `FK_usuario_clave` FOREIGN KEY (`clave_id`) REFERENCES `clave` (`clave_id`),
  CONSTRAINT `FK_usuario_entidad` FOREIGN KEY (`entidad_id`) REFERENCES `entidad` (`entidad_id`)
