DROP TABLE IF EXISTS `usuario_session`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `usuario_session` (
  `usuario_id` varchar(50) NOT NULL,
  `entidad_id` int(11) NOT NULL,
  `ultimo_login` datetime DEFAULT NULL COMMENT 'fecha y hora del ultimo login exitoso',
  `ultimo_cierre` datetime DEFAULT NULL COMMENT 'fecha y hora del ultimo cierre de session exitoso',
  `ultima_accion` datetime DEFAULT NULL COMMENT 'fecha y hora de la ultima accion en el sistema',
  `minutos_validez` int(11) DEFAULT '15' COMMENT 'tiempo en minutos que puede estar un usuario del sistema sin realizar accion antes que su session sea considere inactiva y regrese al login',
  `estado` varchar(3) DEFAULT 'A' COMMENT 'A: activo, I: inactivo o cerrada, BM: bloqueado manual, BI: bloqueado por superar el maximo numero de intentos',
  `ind_politica_inactividad` varchar(1) DEFAULT '0' COMMENT '1/0: si tiene politica de impedir el login si ha dejado una session abierta',
  `datos_ip_login` varchar(100) DEFAULT NULL COMMENT 'datos del ip/remoto del ultimo login exitoso',
  `datos_ip_accion` varchar(100) DEFAULT NULL COMMENT 'datos del ip/remoto de la ultima accion realizada',
  `ind_politica_intentos` varchar(1) DEFAULT '0' COMMENT '1/0: si tiene politica de impedir el login si ha excedido el maximo numero intentos fallidos',
  `numero_intentos` int(11) DEFAULT '10' COMMENT 'numero maximo de intentos fallidos permitidos en el login (es un contador que va decrementando)',
  `nombres_usuario` varchar(100) DEFAULT NULL COMMENT 'nombres de usuario de session a mostrar en la app',
  `apellidos_usuario` varchar(100) DEFAULT NULL COMMENT 'apellidos de usuario de session a mostrar en la app',
  `ind_del` varchar(1) DEFAULT '0' COMMENT '0 = activo ; 1 = eliminado',
  `usu_reg` varchar(50) DEFAULT NULL,
  `fec_reg` datetime DEFAULT NULL,
  `usu_act` varchar(50) DEFAULT NULL,
  `fec_act` datetime DEFAULT NULL,
  PRIMARY KEY (`usuario_id`),
  KEY `FK_usuario_session_entidad` (`entidad_id`),
  KEY `usuario_session_ind_del_IDX` (`ind_del`),
  KEY `usuario_session_estado_IDX` (`estado`),
  CONSTRAINT `FK_usuario_session_entidad` FOREIGN KEY (`entidad_id`) REFERENCES `entidad` (`entidad_id`),
  CONSTRAINT `FK_usuario_session_usuario` FOREIGN KEY (`usuario_id`) REFERENCES `usuario` (`usuario_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

